const ThemeClasses = ({ themesOptions }) => {
  return (
    <>
      <div className='containerFluid1 container1-lg'>
        <div className='mainTitle pb2'>
          <h5 className='fontStyle fsH3'>Font Family:</h5>
        </div>

        <div className='row'>
          {themesOptions.map((thClass, index) => (
            <>
              <div className='col3 fontDefault'>
                <h5 className='fsMD'>fontDefault:</h5>
              </div>
              <div className='col9 fontDefault'>{thClass.theme}</div>
            </>
          ))}
        </div>
      </div>
    </>
  );
};

export default ThemeClasses;
